customElements.define("tag-name",class extends HTMLElement{connectedCallback(t){setTimeout(()=>{this.attachShadow({mode:"open"}).innerHTML="<span part=tag-name><span part=span>‹</span><span part=name>"+(t=this.innerHTML)+"</span><span part=span>›</span><style>:host{white-space:nowrap}:host(:hover){cursor:pointer}[part=span]{line-height:0;font-size:170%;position:relative;top:.07em",this.onclick=(n=>document.location=`https://${t.trim()}.github.io`)})}});